.navbar {
  background-color: #F9F9F9;
  border-bottom: 1px solid #fff;
  z-index: 2;
  position: fixed;
  top: 0;
  width: 100vw;
  height: 6vh;
  min-height: 60px;
}
.navbar .navbar__container {
  display: flex;
}
.navbar .navbar__container img {
  display: none;
}
.navbar .navbar__container .navbar__options {
  display: flex;
  justify-content: space-between;
  width: 80vw;
  min-width: 290px;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  left: 10vw;
  list-style-type: none;
}
.navbar .navbar__container .navbar__options li {
  position: relative;
}
.navbar .navbar__container .navbar__options li a {
  text-decoration: none;
  color: #343434;
}
.navbar .navbar__container .navbar__options li a:hover {
  color: black;
}
.navbar .navbar__container .navbar__options li a::before {
  content: "";
  display: block;
  position: absolute;
  top: 3vh;
  height: 4px;
  width: 0%;
  background: linear-gradient(135.2deg, #12497F 29.35%, #125C90 39.1%, #1291C9 60.68%, #079EDA 64.87%);
  transition: all ease-in-out 250ms;
}
.navbar .navbar__container .navbar__options li a:hover::before {
  width: 100%;
}

.carousel {
  position: relative;
  height: 100vh;
  width: 80vw;
  margin: 0 auto;
}
.carousel .carousel__button {
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  background: transparent;
  border: 0;
  cursor: pointer;
}
.carousel .carousel__button img {
  width: 15px;
}
.carousel .carousel__button--left {
  left: -20px;
}
.carousel .carousel__button--right {
  right: -20px;
}
.carousel .carousel__nav {
  display: flex;
  justify-content: center;
  padding: 10px 0;
  position: relative;
  top: -5%;
}
.carousel .carousel__nav .carousel__indicator {
  border: 0;
  border-radius: 50%;
  width: 15px;
  height: 15px;
  background: rgba(0, 0, 0, 0.3);
  margin: 0 10px;
  cursor: pointer;
}
.carousel .carousel__nav .carousel__indicator.current-slide {
  background: rgba(0, 0, 0, 0.75);
}
.carousel .carousel__track-container {
  height: 100%;
  position: relative;
  overflow: hidden;
}
.carousel .carousel__track-container .carousel__track {
  list-style: none;
  position: relative;
  height: 100%;
  transition: transform 250ms ease-in-out;
}
.carousel .carousel__track-container .carousel__track .carousel__slide {
  position: absolute;
  top: 0;
  bottom: 0;
  width: 100%;
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__text {
  position: absolute;
  top: 10%;
  left: 0;
  width: 50%;
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__text .carousel__cta {
  position: relative;
  top: 35%;
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__text .carousel__text--description {
  padding-top: 5%;
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__image {
  z-index: 0;
  width: 100%;
  height: 100%;
  top: 0;
  object-fit: cover;
}
.carousel .is-hidden {
  display: none;
}

.servicios {
  position: relative;
  height: 94vh;
  width: 90vw;
  margin: 0 auto;
  top: 5vh;
}
.servicios .servicios__title {
  text-transform: uppercase;
  position: relative;
  height: 41px;
  width: 100%;
  top: 10%;
  text-align: center;
}
.servicios .servicios__title h1 {
  vertical-align: middle;
}
.servicios .servicios__container {
  position: relative;
  top: 10%;
  left: 0;
  width: 100%;
  height: 85vh;
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
  grid-gap: 1%;
}
.servicios .servicios__container .servicios__card {
  height: 100%;
  min-height: 35px;
  width: 100%;
  display: grid;
  grid-template-columns: 1fr 3fr;
  grid-template-rows: 1fr;
  grid-template-areas: "icon title";
  align-items: center;
  justify-content: center;
  background-color: white;
  box-shadow: 1px 4px 8px rgba(0, 0, 0, 0.25);
  border-radius: 4px;
}
.servicios .servicios__container .servicios__card .card__img {
  display: none;
}
.servicios .servicios__container .servicios__card .card__icon {
  grid-area: icon;
}
.servicios .servicios__container .servicios__card .card__icon .card__icon--small img {
  width: 80%;
  max-height: 30px;
  margin-left: 10%;
  top: 50%;
  left: 50%;
}
.servicios .servicios__container .servicios__card .card__icon .card__icon--big {
  display: none;
}
.servicios .servicios__container .servicios__card .card__text {
  white-space: nowrap;
  grid: "title";
}
.servicios .servicios__container .servicios__card .card__text h4 {
  justify-content: center;
  align-content: center;
  text-align: start;
}
.servicios .servicios__container .servicios__card .card__text h6 {
  display: none;
}

.contacto {
  position: relative;
  height: 94vh;
  min-height: 600px;
  width: 80vw;
  margin: 0 auto;
  top: 5vh;
}
.contacto .contacto__title {
  text-transform: uppercase;
  position: relative;
  height: 41px;
  width: 100%;
  top: 10%;
  text-align: center;
}
.contacto .contacto__container {
  position: relative;
  top: 10%;
  left: 0;
  width: 100%;
  height: 80vh;
  min-height: 600px;
}
.contacto .contacto__container .contacto__left {
  position: relative;
  top: 0;
  height: 55%;
  width: 100%;
  padding: 3%;
  color: #343434;
  background-color: #1e71b92f;
  border: 2px solid #343434;
  border-radius: 5px;
  backdrop-filter: blur(2px);
}
.contacto .contacto__container .contacto__left form label {
  display: block;
  color: grey;
}
.contacto .contacto__container .contacto__left form textarea {
  padding: 3%;
}
.contacto .contacto__container .contacto__left form input {
  margin-bottom: 2%;
  display: block;
}
.contacto .contacto__container .contacto__right {
  position: relative;
  top: 2%;
  height: 38%;
  width: 100%;
  padding: 5%;
  color: #343434;
  background-color: #1e71b92f;
  border: 2px solid #343434;
  border-radius: 5px;
  backdrop-filter: blur(2px);
  display: flex;
}
.contacto .contacto__container .contacto__right .contacto__right--logo {
  display: none;
}
.contacto .contacto__container .contacto__right .contacto__right--ubicacion {
  display: inline;
  height: 40%;
  position: relative;
  top: 1%;
  left: 1%;
}
.contacto .contacto__container .contacto__right .contacto__right--iconos {
  display: block;
  position: absolute;
  top: 50%;
  left: 5%;
}
.contacto .contacto__container .contacto__right .contacto__right--iconos img {
  list-style-type: none;
  display: flex;
  justify-content: center;
  margin-bottom: 50%;
  max-width: 30px;
}
.contacto .contacto__container .contacto__right .contacto__right--text {
  display: block;
  position: absolute;
  top: 50%;
  left: 20%;
}
.contacto .contacto__container .contacto__right .contacto__right--text .contacto__right--text--mail {
  margin-top: 1.5vh;
}
.contacto .contacto__map iframe {
  display: none;
  z-index: 1;
}

footer {
  position: relative;
  width: 100vw;
  height: 94vh;
  margin: 0 auto;
  top: 15vh;
  bottom: 0;
  background-color: #C4C4C4;
}
footer .footer__container {
  position: relative;
  left: 7%;
  height: 100%;
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: 0.5fr 1.5fr 0.5fr 0.5fr;
  grid-template-areas: "logo" "servicios" "contacto" "redes";
}
footer .footer__container .footer__logo {
  grid-area: logo;
  height: 80%;
}
footer .footer__container .footer__logo img {
  height: 50%;
  top: 50%;
  transform: translateY(50%);
}
footer .footer__container .footer__servicios {
  grid-area: servicios;
  width: 100%;
  height: 90%;
}
footer .footer__container .footer__servicios ul li {
  padding-top: 1%;
  text-decoration: none;
}
footer .footer__container .footer__contacto {
  grid-area: contacto;
  width: 100%;
}
footer .footer__container .footer__contacto ul li {
  padding-top: 3%;
  text-decoration: none;
}
footer .footer__container .footer__redes {
  position: relative;
  grid-area: redes;
  height: 50%;
  width: 60%;
  display: flex;
  align-content: center;
  top: 15%;
}
footer .footer__container .footer__redes a {
  display: flex;
  justify-content: space-between;
  width: 15%;
}
footer .footer__container .footer__redes a img {
  width: 90%;
}

